(37, 1, 'Sousou no Frieren', '<p>Sau một thập kỷ phi&ecirc;u lưu, Frieren c&ugrave;ng tổ đội của dũng sĩ Himmel đ&atilde; đ&aacute;nh bại Ma vương v&agrave; mang lại h&ograve;a b&igrave;nh cho thế giới. Thế rồi c&ocirc; ấy, một Elf với thọ mệnh hơn cả ng&agrave;n năm tuổi, lập lời hứa sẽ t&aacute;i ngộ c&ugrave;ng nh&oacute;m Himmel rồi l&ecirc;n đường đi phi&ecirc;u lưu một m&igrave;nh. 50 năm sau, Frieren đến thăm Himmel, nhưng l&uacute;c n&agrave;y anh ta đ&atilde; gi&agrave; v&agrave; chỉ c&ograve;n lại một ch&uacute;t thời gian ngắn ngủi. Chứng kiến c&aacute;i chết của Himmel, Frieren hối hận v&igrave; đ&atilde; kh&ocirc;ng \"t&igrave;m hiểu nhiều hơn về con người\", v&agrave; thế l&agrave; một chuyến phi&ecirc;u lưu mới của c&ocirc; với mục đ&iacute;ch tr&ecirc;n đ&atilde; bắt đầu. Tr&ecirc;n chuyến phi&ecirc;u lưu n&agrave;y, c&ocirc; đ&atilde; gặp gỡ rất nhiều người v&agrave; trải qua rất nhiều sự kiện.</p>\r\n<p>&nbsp;</p>', 'Sau một thập kỷ phiêu lưu, Frieren cùng tổ đội của dũng sĩ Himmel đã đánh bại Ma vương và mang lại hòa bình cho thế giới. Thế rồi cô ấy, một Elf với thọ mệnh hơn cả ngàn năm tuổi, lập lời hứa sẽ tái ngộ cùng nhóm Himmel rồi lên đường đi phiêu lưu một mình. 50 năm sau, Frieren đến thăm Himmel, nhưng lúc này anh ta đã già và chỉ còn lại một chút thời gian ngắn ngủi. Chứng kiến cái chết của Himmel, Frieren hối hận vì đã không \"tìm hiểu nhiều hơn về con người\", và thế là một chuyến phiêu lưu mới của cô với mục đích trên đã bắt đầu. Trên chuyến phiêu lưu này, cô đã gặp gỡ rất nhiều người và trải qua rất nhiều sự kiện.\r\n ', '', 'sousou-no-frieren', 'Sau một thập kỷ phiêu lưu, Frieren cùng tổ đội của dũng sĩ Himmel đã đánh bại Ma vương và mang lại hòa bình cho thế giới. Thế rồi cô ấy, một Elf với thọ mệnh hơn cả ngàn năm tuổi, lập lời hứa sẽ tái n...', 'sousou-no-frieren', '', '', '', '', ''),
(36, 1, 'Goblin Slayer II', '<p>M&ugrave;a thứ hai của Goblin Slayer .Trong bối cảnh kỳ ảo, nơi m&agrave; mạo hiểm giả từ khắp mọi nơi tr&ecirc;n thế giới đổ về c&ugrave;ng một guild. Họ nhận những nhiệm vụ v&agrave; ho&agrave;n th&agrave;nh ch&uacute;ng để kiếm tiền bạc v&agrave; danh tiếng. Tuy nhi&ecirc;n, kh&ocirc;ng phải mạo hiểm giả n&agrave;o cũng gặp may mắn trong l&uacute;c thực hiện nhiệm vụ. Họ c&oacute; thể bị thương tật, chấn thương t&acirc;m l&yacute;, thậm ch&iacute; l&agrave; mất mạng ngay từ nhiệm vụ đầu ti&ecirc;n v&igrave; qu&aacute; thiếu kinh nghiệm. Một nữ tư tế trẻ tuổi trong chuyến phi&ecirc;u lưu đầu ti&ecirc;n c&ugrave;ng tổ đội mới v&agrave;o nghề đ&atilde; gặp nguy hiểm lớn khi đối đầu với một nh&oacute;m goblin.</p>', 'Mùa thứ hai của Goblin Slayer .Trong bối cảnh kỳ ảo, nơi mà mạo hiểm giả từ khắp mọi nơi trên thế giới đổ về cùng một guild. Họ nhận những nhiệm vụ và hoàn thành chúng để kiếm tiền bạc và danh tiếng. Tuy nhiên, không phải mạo hiểm giả nào cũng gặp may mắn trong lúc thực hiện nhiệm vụ. Họ có thể bị thương tật, chấn thương tâm lý, thậm chí là mất mạng ngay từ nhiệm vụ đầu tiên vì quá thiếu kinh nghiệm. Một nữ tư tế trẻ tuổi trong chuyến phiêu lưu đầu tiên cùng tổ đội mới vào nghề đã gặp nguy hiểm lớn khi đối đầu với một nhóm goblin.', '', 'goblin-slayer-ii', 'Mùa thứ hai của Goblin Slayer .Trong bối cảnh kỳ ảo, nơi mà mạo hiểm giả từ khắp mọi nơi trên thế giới đổ về cùng một guild. Họ nhận những nhiệm vụ và hoàn thành chúng để kiếm tiền bạc và danh tiếng....', 'goblin-slayer-ii', '', '', '', '', ''),
(34, 1, 'Shangri-La Frontier: Kusoge Hunter, Kamige ni Idoman to su', '<p>Học sinh trung học năm thứ hai Rakurou Hizutome chỉ quan t&acirc;m đến một điều duy nhất: t&igrave;m ra những tr&ograve; chơi tồi tệ v&agrave; đ&aacute;nh bại ch&uacute;ng. Kỹ năng chơi game của anh ấy l&agrave; kh&ocirc;ng ai s&aacute;nh kịp v&agrave; kh&ocirc;ng c&oacute; tr&ograve; chơi n&agrave;o qu&aacute; tệ để anh ấy thưởng thức. V&igrave; vậy, khi được giới thiệu về tr&ograve; chơi VR mới Shangri-La Frontier, anh ấy sẽ l&agrave;m những g&igrave; m&igrave;nh giỏi nhất&mdash;tối thiểu v&agrave; bỏ qua phần mở đầu để bắt tay v&agrave;o h&agrave;nh động ngay. Nhưng liệu một game thủ l&atilde;o luyện như Rakurou c&oacute; thể kh&aacute;m ph&aacute; được tất cả những b&iacute; mật m&agrave; Shangri-La Frontier che giấu&hellip;?</p>', 'Học sinh trung học năm thứ hai Rakurou Hizutome chỉ quan tâm đến một điều duy nhất: tìm ra những trò chơi tồi tệ và đánh bại chúng. Kỹ năng chơi game của anh ấy là không ai sánh kịp và không có trò chơi nào quá tệ để anh ấy thưởng thức. Vì vậy, khi được giới thiệu về trò chơi VR mới Shangri-La Frontier, anh ấy sẽ làm những gì mình giỏi nhất—tối thiểu và bỏ qua phần mở đầu để bắt tay vào hành động ngay. Nhưng liệu một game thủ lão luyện như Rakurou có thể khám phá được tất cả những bí mật mà Shangri-La Frontier che giấu…?', '', 'shangri-la-frontier-kusoge-hunter-kamige-ni-idoman-to-su', 'Học sinh trung học năm thứ hai Rakurou Hizutome chỉ quan tâm đến một điều duy nhất: tìm ra những trò chơi tồi tệ và đánh bại chúng. Kỹ năng chơi game của anh ấy là không ai sánh kịp và không có trò ch...', 'shangri-la-frontier-kusoge-hunter-kamige-ni-idoman-to-su', '', '', '', '', ''),
(35, 1, 'Undead Unluck', '<p>Sau khi đọc phần kết của bộ truyện tranh y&ecirc;u th&iacute;ch của m&igrave;nh, Fuuko Izumo cuối c&ugrave;ng cũng cảm thấy sẵn s&agrave;ng chấm dứt sự tồn tại của m&igrave;nh. Trong 10 năm qua, Fuuko đ&atilde; phải chịu đựng một căn bệnh mang lại bất hạnh tột c&ugrave;ng cho bất cứ ai chạm v&agrave;o c&ocirc;. Điều n&agrave;y đ&atilde; ảnh hưởng mạnh mẽ đến m&ocirc;i trường xung quanh c&ocirc;, thậm ch&iacute; v&ocirc; t&igrave;nh dẫn đến c&aacute;i chết của những người xung quanh &mdash; bao gồm cả cha mẹ c&ocirc;. Khi c&ocirc; đang đứng tr&ecirc;n c&acirc;y cầu ph&iacute;a tr&ecirc;n đường ray xe lửa, Fuuko bị một người đ&agrave;n &ocirc;ng lạ chạm v&agrave;o, khiến ch&acirc;n cầu b&ecirc;n dưới anh bị g&atilde;y v&agrave; thả anh xuống trước một đo&agrave;n t&agrave;u đang lao tới. Tuy nhi&ecirc;n, khi Fuuko t&igrave;m thấy x&aacute;c của người đ&agrave;n &ocirc;ng đ&oacute;, c&ocirc; ph&aacute;t hiện ra rằng cơ thể anh ta đang t&aacute;i sinh v&agrave; anh ta đang sống lại. Người đ&agrave;n &ocirc;ng m&agrave; Fuuko đặt t&ecirc;n l&agrave; Andy, l&agrave; người bất tử&mdash;v&agrave; giống như c&ocirc;, anh cũng mong muốn được chết. Ban đầu b&aacute;c bỏ, Fuuko cuối c&ugrave;ng quyết định hợp t&aacute;c với Andy để cho anh ta c&aacute;i chết tốt nhất c&oacute; thể; nhưng một tổ chức b&iacute; ẩn ẩn nấp trong b&oacute;ng tối với hy vọng lợi dụng khả năng kỳ qu&aacute;i của bộ đ&ocirc;i n&agrave;y</p>', 'Sau khi đọc phần kết của bộ truyện tranh yêu thích của mình, Fuuko Izumo cuối cùng cũng cảm thấy sẵn sàng chấm dứt sự tồn tại của mình. Trong 10 năm qua, Fuuko đã phải chịu đựng một căn bệnh mang lại bất hạnh tột cùng cho bất cứ ai chạm vào cô. Điều này đã ảnh hưởng mạnh mẽ đến môi trường xung quanh cô, thậm chí vô tình dẫn đến cái chết của những người xung quanh — bao gồm cả cha mẹ cô. Khi cô đang đứng trên cây cầu phía trên đường ray xe lửa, Fuuko bị một người đàn ông lạ chạm vào, khiến chân cầu bên dưới anh bị gãy và thả anh xuống trước một đoàn tàu đang lao tới. Tuy nhiên, khi Fuuko tìm thấy xác của người đàn ông đó, cô phát hiện ra rằng cơ thể anh ta đang tái sinh và anh ta đang sống lại. Người đàn ông mà Fuuko đặt tên là Andy, là người bất tử—và giống như cô, anh cũng mong muốn được chết. Ban đầu bác bỏ, Fuuko cuối cùng quyết định hợp tác với Andy để cho anh ta cái chết tốt nhất có thể; nhưng một tổ chức bí ẩn ẩn nấp trong bóng tối với hy vọng lợi dụng khả năng kỳ quái của bộ đôi này', '', 'undead-unluck', 'Sau khi đọc phần kết của bộ truyện tranh yêu thích của mình, Fuuko Izumo cuối cùng cũng cảm thấy sẵn sàng chấm dứt sự tồn tại của mình. Trong 10 năm qua, Fuuko đã phải chịu đựng một căn bệnh mang lại...', 'undead-unluck', '', '', '', '', ''),
(25, 1, 'Boushoku no Berserk', '<p>Phim l&agrave; c&acirc;u chuyện về Fate Graphite, người đ&agrave;n &ocirc;ng c&oacute; sức mạnh v&agrave; m&oacute;n qu&agrave; sức mạnh. Nhưng điểm nổi bật của c&acirc;u chuyện l&agrave; việc anh ta bị nguyền rủa bởi sức mạnh của &Aacute;c thực. Nhưng biết được tr&aacute;ch nhiệm của thế lực n&agrave;y, mc bị l&acirc;m v&agrave;o t&igrave;nh thế ngặt ngh&egrave;o. Chẳng mấy chốc, sự khao kh&aacute;t đế gi&agrave;y lộ r&otilde; ​​trong người đ&agrave;n &ocirc;ng. Thời gian tr&ocirc;i qua, anh ta ng&agrave;y c&agrave;ng &iacute;t c&oacute; khả năng kiểm so&aacute;t sự th&ocirc;i th&uacute;c. V&agrave; v&igrave; vậy, &yacute; tưởng l&agrave; kiểm so&aacute;t tất cả c&aacute;c sức mạnh v&agrave; trở th&agrave;nh kẻ mạnh nhất v&agrave; quyền lực nhất. Đ&acirc;y l&agrave; nơi ch&uacute;ng ta t&igrave;m thấy người phụ nữ bước v&agrave;o cuộc đời anh. Sẽ rất th&uacute; vị để xem c&ocirc; ấy l&agrave;m g&igrave; để gi&uacute;p anh ta kiểm so&aacute;t ham muốn giết chết sự tồn tại của con người</p>\r\n<p>&nbsp;</p>', 'Phim là câu chuyện về Fate Graphite, người đàn ông có sức mạnh và món quà sức mạnh. Nhưng điểm nổi bật của câu chuyện là việc anh ta bị nguyền rủa bởi sức mạnh của Ác thực. Nhưng biết được trách nhiệm của thế lực này, mc bị lâm vào tình thế ngặt nghèo. Chẳng mấy chốc, sự khao khát đế giày lộ rõ ​​trong người đàn ông. Thời gian trôi qua, anh ta ngày càng ít có khả năng kiểm soát sự thôi thúc. Và vì vậy, ý tưởng là kiểm soát tất cả các sức mạnh và trở thành kẻ mạnh nhất và quyền lực nhất. Đây là nơi chúng ta tìm thấy người phụ nữ bước vào cuộc đời anh. Sẽ rất thú vị để xem cô ấy làm gì để giúp anh ta kiểm soát ham muốn giết chết sự tồn tại của con người\r\n ', '', 'boushoku-no-berserk', 'Phim là câu chuyện về Fate Graphite, người đàn ông có sức mạnh và món quà sức mạnh. Nhưng điểm nổi bật của câu chuyện là việc anh ta bị nguyền rủa bởi sức mạnh của Ác thực. Nhưng biết được trách nhiệm...', 'boushoku-no-berserk', '', '', '', '', ''),
(38, 1, 'Ragna Crimson', '<p>Trong một thế giới nơi rồng thống trị bầu trời, biển v&agrave; đất, những ai chiến đấu với ch&uacute;ng v&agrave; gi&agrave;nh chiến thắng phải vượt qua giới hạn sức mạnh b&igrave;nh thường của con người. Quyết t&acirc;m gi&agrave;nh chiến thắng bằng mọi gi&aacute;, thợ săn rồng Ragna hợp lực với Crimson b&iacute; ẩn. Động cơ của Crimson c&oacute; thể kh&ocirc;ng r&otilde; r&agrave;ng, nhưng mục ti&ecirc;u của họ đều giống nhau: ti&ecirc;u diệt c&aacute;c vua rồng.</p>\r\n<p>&nbsp;</p>', 'Trong một thế giới nơi rồng thống trị bầu trời, biển và đất, những ai chiến đấu với chúng và giành chiến thắng phải vượt qua giới hạn sức mạnh bình thường của con người. Quyết tâm giành chiến thắng bằng mọi giá, thợ săn rồng Ragna hợp lực với Crimson bí ẩn. Động cơ của Crimson có thể không rõ ràng, nhưng mục tiêu của họ đều giống nhau: tiêu diệt các vua rồng.\r\n ', '', 'ragna-crimson', 'Trong một thế giới nơi rồng thống trị bầu trời, biển và đất, những ai chiến đấu với chúng và giành chiến thắng phải vượt qua giới hạn sức mạnh bình thường của con người. Quyết tâm giành chiến thắng bằ...', 'ragna-crimson', '', '', '', '', ''),
(39, 1, 'Hametsu no Oukoku', '<p>Con người từ xưa đ&atilde; sống dưới sự bảo hộ của ph&ugrave; thủy, họ t&ocirc;n k&iacute;nh, biết ơn v&agrave; đồng thời cũng cảm thấy ... KHIẾP SỢ trước năng lực của c&aacute;c ph&ugrave; thủy. Con người muốn nổi dậy, muốn chứng minh rằng thế giới hiện nay l&agrave; do họ l&agrave;m chủ ... Họ truy l&ugrave;ng, tận diệt c&aacute;c ph&ugrave; thủy c&ograve;n s&oacute;t lại cho đến kẻ cuối c&ugrave;ng. Nhưng nh&acirc;n loại kh&ocirc;ng ngờ rằng, ở đ&acirc;u đ&oacute; c&oacute; một thiếu ni&ecirc;n l&agrave; con người nhưng lại được cứu gi&uacute;p v&agrave; cưu mang bởi ph&ugrave; thủy, chứng kiến cảnh người m&igrave;nh y&ecirc;u thương bị ch&iacute;nh chủng tộc m&igrave;nh s&aacute;t hại t&agrave;n nhẫn.</p>', 'Con người từ xưa đã sống dưới sự bảo hộ của phù thủy, họ tôn kính, biết ơn và đồng thời cũng cảm thấy ... KHIẾP SỢ trước năng lực của các phù thủy. Con người muốn nổi dậy, muốn chứng minh rằng thế giới hiện nay là do họ làm chủ ... Họ truy lùng, tận diệt các phù thủy còn sót lại cho đến kẻ cuối cùng. Nhưng nhân loại không ngờ rằng, ở đâu đó có một thiếu niên là con người nhưng lại được cứu giúp và cưu mang bởi phù thủy, chứng kiến cảnh người mình yêu thương bị chính chủng tộc mình sát hại tàn nhẫn.', '', 'hametsu-no-oukoku', 'Con người từ xưa đã sống dưới sự bảo hộ của phù thủy, họ tôn kính, biết ơn và đồng thời cũng cảm thấy ... KHIẾP SỢ trước năng lực của các phù thủy. Con người muốn nổi dậy, muốn chứng minh rằng thế giớ...', 'hametsu-no-oukoku', '', '', '', '', ''),
(40, 1, 'Tate no Yuusha no Nariagari Seasion 1', '<p>Iwatani Naofumi bị triệu hồi v&agrave;o thế giới song song c&ugrave;ng với 3 thằng đực rựa kh&aacute;c. Mỗi đứa đều được trang bị 4 thanh Huyền Kh&iacute; khi được triệu hồi, Naofumi được nhận Huyền Thuẫn. Tiếc c&aacute;i ở c&aacute;i thế giới n&agrave;y lại t&ocirc;n thờ Tam Đại Th&aacute;nh Kh&iacute; (ch&eacute;m đ&oacute;) bao gồm Thương, Cung, Kiếm v&agrave; tất nhi&ecirc;n Khi&ecirc;n lại được cho l&agrave; thứ t&agrave; gi&aacute;o. Naofumi vừa được triệu hồi sẽ phải đối mặt với sự phản bội, sự t&agrave;n bạo, sự ch&agrave; đạp,... của ch&iacute;nh những kẻ gọi l&agrave; con người ở đ&acirc;y. Liệu Naofumi sẽ chấp nhận cuộc sống kh&ocirc;ng bằng người đ&oacute; hay sẽ đứng dậy luyện kh&iacute; bứt ph&aacute; đập chết tụi n&oacute;?</p>', 'Iwatani Naofumi bị triệu hồi vào thế giới song song cùng với 3 thằng đực rựa khác. Mỗi đứa đều được trang bị 4 thanh Huyền Khí khi được triệu hồi, Naofumi được nhận Huyền Thuẫn. Tiếc cái ở cái thế giới này lại tôn thờ Tam Đại Thánh Khí (chém đó) bao gồm Thương, Cung, Kiếm và tất nhiên Khiên lại được cho là thứ tà giáo. Naofumi vừa được triệu hồi sẽ phải đối mặt với sự phản bội, sự tàn bạo, sự chà đạp,... của chính những kẻ gọi là con người ở đây. Liệu Naofumi sẽ chấp nhận cuộc sống không bằng người đó hay sẽ đứng dậy luyện khí bứt phá đập chết tụi nó?', '', 'tate-no-yuusha-no-nariagari-seasion-1', 'Iwatani Naofumi bị triệu hồi vào thế giới song song cùng với 3 thằng đực rựa khác. Mỗi đứa đều được trang bị 4 thanh Huyền Khí khi được triệu hồi, Naofumi được nhận Huyền Thuẫn. Tiếc cái ở cái thế giớ...', 'tate-no-yuusha-no-nariagari-seasion-1', '', '', '', '', ''),
(41, 1, 'Tate no Yuusha no Nariagari Seasion 3', '<p>M&ugrave;a thứ 3 của Series anime Tate no Yuusha no Nariagari</p>', 'Mùa thứ 3 của Series anime Tate no Yuusha no Nariagari', '', 'tate-no-yuusha-no-nariagari-seasion-3', 'Mùa thứ 3 của Series anime Tate no Yuusha no Nariagari', 'tate-no-yuusha-no-nariagari-seasion-3', '', '', '', '', ''),
(42, 1, 'Keikenzumi na Kimi to, Keiken Zero na Ore ga, Otsukiai suru Hanashi.', '<p>\"T-tớ th&iacute;ch cậu\" \"Hể? Susuki!?\" Kashima Ryuuto l&agrave; một cậu nam sinh tẻ nhạt, buồn ch&aacute;n. Trong một tr&ograve; chơi trừng phạt, cậu đ&atilde; bị buộc phải tỏ t&igrave;nh với Shirakawa Runa, c&ocirc; n&agrave;ng nữ sinh nổi tiếng nhất trường. Thế nhưng, cuối c&ugrave;ng hai người họ lại hẹn h&ograve; với nhau chỉ bằng một c&acirc;u n&oacute;i đầy bất ngờ. \"Ể? Tớ vẫn chưa c&oacute; người y&ecirc;u n&ecirc;n l&agrave;...\" D&ugrave; Ryuuto biết c&oacute; một ch&agrave;ng trai ở clb b&oacute;ng đ&aacute; đ&atilde; tỏ t&igrave;nh với Shirakawa, nhưng c&ocirc; vẫn chọn cậu v&agrave; dẫn cậu về ph&ograve;ng của m&igrave;nh. Cả hai người đều c&oacute; những người bạn v&agrave; niềm vui th&uacute; kh&aacute;c nhau. Thế nhưng, họ vẫn chấp nhận những điều kh&aacute;c biệt ấy cho nhau v&agrave; tiến tới việc hẹn h&ograve;.</p>', '\"T-tớ thích cậu\" \"Hể? Susuki!?\" Kashima Ryuuto là một cậu nam sinh tẻ nhạt, buồn chán. Trong một trò chơi trừng phạt, cậu đã bị buộc phải tỏ tình với Shirakawa Runa, cô nàng nữ sinh nổi tiếng nhất trường. Thế nhưng, cuối cùng hai người họ lại hẹn hò với nhau chỉ bằng một câu nói đầy bất ngờ. \"Ể? Tớ vẫn chưa có người yêu nên là...\" Dù Ryuuto biết có một chàng trai ở clb bóng đá đã tỏ tình với Shirakawa, nhưng cô vẫn chọn cậu và dẫn cậu về phòng của mình. Cả hai người đều có những người bạn và niềm vui thú khác nhau. Thế nhưng, họ vẫn chấp nhận những điều khác biệt ấy cho nhau và tiến tới việc hẹn hò.', '', 'keikenzumi-na-kimi-to-keiken-zero-na-ore-ga-otsukiai-suru-hanashi', '\"T-tớ thích cậu\" \"Hể? Susuki!?\" Kashima Ryuuto là một cậu nam sinh tẻ nhạt, buồn chán. Trong một trò chơi trừng phạt, cậu đã bị buộc phải tỏ tình với Shirakawa Runa, cô nàng nữ sinh nổi tiếng nhất trư...', 'keikenzumi-na-kimi-to-keiken-zero-na-ore-ga-otsukiai-suru-hanashi', '', '', '', '', ''),
(43, 1, 'Dark Gathering', '<p>Keitarou Gentouga l&agrave; một sinh vi&ecirc;n đại học rất gh&eacute;t ma quỷ. Nhưng kh&ocirc;ng may, cậu lại rất thu h&uacute;t c&aacute;c hồn ma. Hai năm trước, ch&iacute;nh khả năng thu h&uacute;t ma quỷ đ&atilde; khiến cậu bị một vết thương t&acirc;m linh tr&ecirc;n tay phải v&agrave; khiến cả người bạn của m&igrave;nh bị cuốn v&agrave;o vụ việc. Sự kiện n&agrave;y khiến cậu trở th&agrave;nh một người kh&eacute;p k&iacute;n, xa l&aacute;nh x&atilde; hội. May mắn thay, nhờ c&oacute; người bạn thời thơ ấu Eiko Houzuki, Keitarou cũng đ&atilde; c&oacute; thể dần t&aacute;i h&ograve;a nhập x&atilde; hội. Như một phần trong qu&aacute; tr&igrave;nh t&aacute;i h&ograve;a nhập x&atilde; hội, Keitarou đi l&agrave;m th&ecirc;m gia sư. Học tr&ograve; đầu ti&ecirc;n của cậu ch&iacute;nh l&agrave; em họ của Eiko, Yayou Houzuki. B&ecirc;n cạnh việc l&agrave; một thần đồng, Yayoi c&ograve;n c&oacute; một thể chất t&acirc;m linh giống như Keitarou. Tuy nhi&ecirc;n ngược lại với Keitarou, Yayoi lu&ocirc;n khao kh&aacute;t được gặp gỡ c&aacute;c linh hồn để t&igrave;m &aacute;c linh đ&atilde; bắt mẹ c&ocirc;. V&agrave; c&oacute; vẻ như c&ocirc;ng việc l&agrave;m th&ecirc;m của Keitarou ng&agrave;y c&agrave;ng xa rời mục đ&iacute;ch ban đầu khi Eiko v&agrave; Yayoi li&ecirc;n tục k&eacute;o cậu tới những địa điểm bị ma &aacute;m...</p>\r\n<p>&nbsp;</p>', 'Keitarou Gentouga là một sinh viên đại học rất ghét ma quỷ. Nhưng không may, cậu lại rất thu hút các hồn ma. Hai năm trước, chính khả năng thu hút ma quỷ đã khiến cậu bị một vết thương tâm linh trên tay phải và khiến cả người bạn của mình bị cuốn vào vụ việc. Sự kiện này khiến cậu trở thành một người khép kín, xa lánh xã hội. May mắn thay, nhờ có người bạn thời thơ ấu Eiko Houzuki, Keitarou cũng đã có thể dần tái hòa nhập xã hội. Như một phần trong quá trình tái hòa nhập xã hội, Keitarou đi làm thêm gia sư. Học trò đầu tiên của cậu chính là em họ của Eiko, Yayou Houzuki. Bên cạnh việc là một thần đồng, Yayoi còn có một thể chất tâm linh giống như Keitarou. Tuy nhiên ngược lại với Keitarou, Yayoi luôn khao khát được gặp gỡ các linh hồn để tìm ác linh đã bắt mẹ cô. Và có vẻ như công việc làm thêm của Keitarou ngày càng xa rời mục đích ban đầu khi Eiko và Yayoi liên tục kéo cậu tới những địa điểm bị ma ám...\r\n ', '', 'dark-gathering', 'Keitarou Gentouga là một sinh viên đại học rất ghét ma quỷ. Nhưng không may, cậu lại rất thu hút các hồn ma. Hai năm trước, chính khả năng thu hút ma quỷ đã khiến cậu bị một vết thương tâm linh trên t...', 'dark-gathering', '', '', '', '', ''),
(44, 1, 'Kusuriya no Hitorigoto', '<p>Trong một triều đ&igrave;nh ở Trung Quốc cổ đại, đ&atilde; v&agrave;i th&aacute;ng kể từ khi một c&ocirc; g&aacute;i 17 tuổi t&ecirc;n l&agrave; Maomao bị bắt c&oacute;c v&agrave; buộc phải l&agrave;m người hầu cấp thấp trong cung điện của ho&agrave;ng đế. Tuy nhi&ecirc;n, c&ocirc; vẫn giữ được tinh thần t&ograve; m&ograve; v&agrave; thực dụng của m&igrave;nh, dự định l&agrave;m việc cho đến khi hết năm n&ocirc; lệ. Tuy nhi&ecirc;n, một ng&agrave;y nọ, c&ocirc; biết được tin hai đứa con của ho&agrave;ng đế l&acirc;m bệnh nặng. C&ocirc; quyết định b&iacute; mật h&agrave;nh động, dựa tr&ecirc;n kinh nghiệm l&agrave;m dược sĩ lớn l&ecirc;n ở khu đ&egrave;n đỏ ngh&egrave;o kh&oacute;.</p>\r\n<p>Bất chấp nỗ lực giấu t&ecirc;n của Maomao, c&ocirc; sớm lọt v&agrave;o mắt xanh của Jinshi, một th&aacute;i gi&aacute;m c&oacute; ảnh hưởng v&agrave; nhận ra t&agrave;i năng của c&ocirc;. Maomao sớm nhận ra m&igrave;nh đang ở trong nội cung của ho&agrave;ng đế, nơi c&ocirc; dần tạo dựng t&ecirc;n tuổi cho m&igrave;nh bằng c&aacute;ch sử dụng kiến ​​thức v&agrave; t&iacute;nh c&aacute;ch lập dị của m&igrave;nh để giải quyết nhiều b&iacute; ẩn y học kh&aacute;c nhau.</p>', 'Trong một triều đình ở Trung Quốc cổ đại, đã vài tháng kể từ khi một cô gái 17 tuổi tên là Maomao bị bắt cóc và buộc phải làm người hầu cấp thấp trong cung điện của hoàng đế. Tuy nhiên, cô vẫn giữ được tinh thần tò mò và thực dụng của mình, dự định làm việc cho đến khi hết năm nô lệ. Tuy nhiên, một ngày nọ, cô biết được tin hai đứa con của hoàng đế lâm bệnh nặng. Cô quyết định bí mật hành động, dựa trên kinh nghiệm làm dược sĩ lớn lên ở khu đèn đỏ nghèo khó.\r\nBất chấp nỗ lực giấu tên của Maomao, cô sớm lọt vào mắt xanh của Jinshi, một thái giám có ảnh hưởng và nhận ra tài năng của cô. Maomao sớm nhận ra mình đang ở trong nội cung của hoàng đế, nơi cô dần tạo dựng tên tuổi cho mình bằng cách sử dụng kiến ​​thức và tính cách lập dị của mình để giải quyết nhiều bí ẩn y học khác nhau.', '', 'kusuriya-no-hitorigoto', 'Trong một triều đình ở Trung Quốc cổ đại, đã vài tháng kể từ khi một cô gái 17 tuổi tên là Maomao bị bắt cóc và buộc phải làm người hầu cấp thấp trong cung điện của hoàng đế. Tuy nhiên, cô vẫn giữ đượ...', 'kusuriya-no-hitorigoto', '', '', '', '', ''),
(45, 1, 'Mushoku Tensei: Isekai Ittara Honki Dasu', '<p>\"T&ocirc;i sẽ nghi&ecirc;m t&uacute;c ở c&aacute;i dị giới n&agrave;y!\"</p>\r\n<p>C&oacute; một người đ&agrave;n &ocirc;ng 34 tuổi vẫn l&agrave; giai t&acirc;n, thất nghiệp, một NEET ch&iacute;nh hiệu. V&agrave;o đ&uacute;ng ng&agrave;y tang lễ của cha mẹ m&igrave;nh, anh bị họ h&agrave;ng đuổi ra khỏi nh&agrave;, rồi bị xe tải t&ocirc;ng chết m&agrave; qua đời. Khi tỉnh lại, anh nhận ra m&igrave;nh đ&atilde; đầu thai v&agrave;o một đứa b&eacute; ở một thế giới xa lạ với kiếm v&agrave; ma ph&aacute;p!</p>\r\n<p>Từng sống như một kẻ cặn b&atilde; của x&atilde; hội, nay anh quyết t&acirc;m l&agrave;m lại cuộc đời dưới dưới c&aacute;i t&ecirc;n Rudeus!</p>\r\n<p>Đ&oacute;n đợi anh l&agrave; một c&ocirc; n&agrave;ng ma thuật sĩ b&eacute; nhỏ, một c&ocirc; b&eacute; xinh đẹp mang đ&ocirc;i tai Elf, một tiểu thư Tsundere hung dữ v&agrave; biết bao nh&acirc;n vật kh&aacute;c...</p>\r\n<p>H&agrave;nh tr&igrave;nh c&ugrave;ng những cuộc chiến khốc liệt bắt đầu.</p>\r\n<p>\"C&acirc;u chuyện kỳ ảo về h&agrave;nh tr&igrave;nh l&agrave;m lại cuộc đời bắt đầu!\"</p>', '\"Tôi sẽ nghiêm túc ở cái dị giới này!\"\r\nCó một người đàn ông 34 tuổi vẫn là giai tân, thất nghiệp, một NEET chính hiệu. Vào đúng ngày tang lễ của cha mẹ mình, anh bị họ hàng đuổi ra khỏi nhà, rồi bị xe tải tông chết mà qua đời. Khi tỉnh lại, anh nhận ra mình đã đầu thai vào một đứa bé ở một thế giới xa lạ với kiếm và ma pháp!\r\nTừng sống như một kẻ cặn bã của xã hội, nay anh quyết tâm làm lại cuộc đời dưới dưới cái tên Rudeus!\r\nĐón đợi anh là một cô nàng ma thuật sĩ bé nhỏ, một cô bé xinh đẹp mang đôi tai Elf, một tiểu thư Tsundere hung dữ và biết bao nhân vật khác...\r\nHành trình cùng những cuộc chiến khốc liệt bắt đầu.\r\n\"Câu chuyện kỳ ảo về hành trình làm lại cuộc đời bắt đầu!\"', '', 'mushoku-tensei-isekai-ittara-honki-dasu', '\"Tôi sẽ nghiêm túc ở cái dị giới này!\"\r\nCó một người đàn ông 34 tuổi vẫn là giai tân, thất nghiệp, một NEET chính hiệu. Vào đúng ngày tang lễ của cha mẹ mình, anh bị họ hàng đuổi ra khỏi nhà, rồi bị x...', 'mushoku-tensei-isekai-ittara-honki-dasu', '', '', '', '', ''),
(46, 1, 'Mushoku Tensei: Isekai Ittara Honki Dasu Part 2', '<p>Nửa sau của Mushoku Tensei: Isekai Ittara Honki Dasu .</p>', 'Nửa sau của Mushoku Tensei: Isekai Ittara Honki Dasu .', '', 'mushoku-tensei-isekai-ittara-honki-dasu-part-2', 'Nửa sau của Mushoku Tensei: Isekai Ittara Honki Dasu .', 'mushoku-tensei-isekai-ittara-honki-dasu-part-2', '', '', '', '', ''),
(47, 1, 'Masamune-kun no Revenge', '<p>Makabe Masamune l&uacute;c nhỏ chỉ l&agrave; một con heo v&ocirc; dụng yếu đuối, nhưng từ khi tỏ t&igrave;nh thất bại với Adagaki, tuyệt vọng khi bị chế nhạo n&ecirc;n Makabe quyết t&acirc;m nỗ lực r&egrave;n luyện m&igrave;nh v&agrave; vạch ra một kế hoạch ho&agrave;n hảo để trả th&ugrave; Adagaki. T&aacute;m năm sau, cậu đ&atilde; trở th&agrave;nh một anh ch&agrave;ng đẹp trai, th&acirc;n h&igrave;nh đầy đặn với th&agrave;nh t&iacute;ch xuất sắc đậu v&agrave;o trường của Adagaki đang học. Liệu cậu c&oacute; thể trả th&ugrave; hay kh&ocirc;ng? C&ugrave;ng nhau theo d&otilde;i c&acirc;u chuyện n&agrave;o...</p>', 'Makabe Masamune lúc nhỏ chỉ là một con heo vô dụng yếu đuối, nhưng từ khi tỏ tình thất bại với Adagaki, tuyệt vọng khi bị chế nhạo nên Makabe quyết tâm nỗ lực rèn luyện mình và vạch ra một kế hoạch hoàn hảo để trả thù Adagaki. Tám năm sau, cậu đã trở thành một anh chàng đẹp trai, thân hình đầy đặn với thành tích xuất sắc đậu vào trường của Adagaki đang học. Liệu cậu có thể trả thù hay không? Cùng nhau theo dõi câu chuyện nào...', '', 'masamune-kun-no-revenge', 'Makabe Masamune lúc nhỏ chỉ là một con heo vô dụng yếu đuối, nhưng từ khi tỏ tình thất bại với Adagaki, tuyệt vọng khi bị chế nhạo nên Makabe quyết tâm nỗ lực rèn luyện mình và vạch ra một kế hoạch ho...', 'masamune-kun-no-revenge', '', '', '', '', ''),
