(49, 1, 'Masamune-kun no Revenge R', '<p>M&ugrave;a thứ hai của Masamune-kun no Revenge .</p>', 'Mùa thứ hai của Masamune-kun no Revenge .', '', 'masamune-kun-no-revenge-r', 'Mùa thứ hai của Masamune-kun no Revenge .', 'masamune-kun-no-revenge-r', '', '', '', '', ''),
(50, 1, 'Eiyuu Kyoushitsu', '<p>C&aacute;ch đấy kh&ocirc;ng l&acirc;u vua quỷ h&ugrave;ng mạnh đ&atilde; chiến đấu c&ugrave;ng anh h&ugrave;ng v&agrave; bị anh ấy hạ gục. để ph&ograve;ng ngừa thảm họa n&agrave;y lần nữa học viện Rosewood đ&atilde; bắt đầu huấn luyện c&aacute;c anh h&ugrave;ng tuogw lai. một học sinh mới chuyển trường mới t&igrave;nh t&iacute;nh hời hợt nhưng với sức mạnh vượt trội.. chỉ l&agrave; cậu chỉ th&iacute;ch c&oacute; một cuộc sống b&igrave;nh thường. cậu ấy l&agrave; ai v&agrave; tại sao lại được chuyển đến học viện n&agrave;y?</p>', 'Cách đấy không lâu vua quỷ hùng mạnh đã chiến đấu cùng anh hùng và bị anh ấy hạ gục. để phòng ngừa thảm họa này lần nữa học viện Rosewood đã bắt đầu huấn luyện các anh hùng tuogw lai. một học sinh mới chuyển trường mới tình tính hời hợt nhưng với sức mạnh vượt trội.. chỉ là cậu chỉ thích có một cuộc sống bình thường. cậu ấy là ai và tại sao lại được chuyển đến học viện này?', '', 'eiyuu-kyoushitsu', 'Cách đấy không lâu vua quỷ hùng mạnh đã chiến đấu cùng anh hùng và bị anh ấy hạ gục. để phòng ngừa thảm họa này lần nữa học viện Rosewood đã bắt đầu huấn luyện các anh hùng tuogw lai. một học sinh mới...', 'eiyuu-kyoushitsu', '', '', '', '', ''),
(51, 1, 'Shy', '<p>V&agrave;o giữa thế kỷ 21, chiến tranh đ&atilde; biến mất khỏi tr&aacute;i đất. Thế rồi đột nhi&ecirc;n, những con người c&oacute; sức mạnh si&ecirc;u ph&agrave;m, được gọi l&agrave; \"\"anh h&ugrave;ng\"\", đ&atilde; đồng loạt xuất hiện tại nhiều quốc gia kh&aacute;c nhau, khiến c&ocirc;ng cuộc t&igrave;m kiếm h&ograve;a b&igrave;nh c&oacute; những thay đổi đ&aacute;ng kể. Trong một thế giới m&agrave; những anh h&ugrave;ng từ c&aacute;c quốc gia kh&aacute;c nhau l&agrave;m việc để duy tr&igrave; nền h&ograve;a b&igrave;nh mới t&igrave;m được, người chịu tr&aacute;ch nhiệm cho h&ograve;a b&igrave;nh của Nhật Bản l&agrave; một nữ anh h&ugrave;ng rụt r&egrave;, rất ngại xuất hiện trước c&ocirc;ng ch&uacute;ng, t&ecirc;n l&agrave; SHY.</p>', 'Vào giữa thế kỷ 21, chiến tranh đã biến mất khỏi trái đất. Thế rồi đột nhiên, những con người có sức mạnh siêu phàm, được gọi là \"\"anh hùng\"\", đã đồng loạt xuất hiện tại nhiều quốc gia khác nhau, khiến công cuộc tìm kiếm hòa bình có những thay đổi đáng kể. Trong một thế giới mà những anh hùng từ các quốc gia khác nhau làm việc để duy trì nền hòa bình mới tìm được, người chịu trách nhiệm cho hòa bình của Nhật Bản là một nữ anh hùng rụt rè, rất ngại xuất hiện trước công chúng, tên là SHY.', '', 'shy', 'Vào giữa thế kỷ 21, chiến tranh đã biến mất khỏi trái đất. Thế rồi đột nhiên, những con người có sức mạnh siêu phàm, được gọi là \"\"anh hùng\"\", đã đồng loạt xuất hiện tại nhiều quốc gia khác nhau, khiế...', 'shy', '', '', '', '', ''),
(52, 1, 'Dekoboko Majo no Oyako Jijou', '<p>Một ph&ugrave; thủy sống một m&igrave;nh trong rừng nọ. Ng&agrave;y nọ, c&ocirc; t&igrave;m thấy một đứa trẻ v&agrave; quyết định đem về nu&ocirc;i. 16 năm sau, c&ocirc; b&eacute; lớn vượt mong đợi v&agrave;....</p>', 'Một phù thủy sống một mình trong rừng nọ. Ngày nọ, cô tìm thấy một đứa trẻ và quyết định đem về nuôi. 16 năm sau, cô bé lớn vượt mong đợi và....', '', 'dekoboko-majo-no-oyako-jijou', 'Một phù thủy sống một mình trong rừng nọ. Ngày nọ, cô tìm thấy một đứa trẻ và quyết định đem về nuôi. 16 năm sau, cô bé lớn vượt mong đợi và....', 'dekoboko-majo-no-oyako-jijou', '', '', '', '', ''),
(53, 1, 'Kage no Jitsuryokusha ni Naritakute! 2nd Season', '<p>M&ugrave;a 2 bộ anime Ta Muốn Trở Th&agrave;nh Ch&uacute;a Tể B&oacute;ng Tối</p>', 'Mùa 2 bộ anime Ta Muốn Trở Thành Chúa Tể Bóng Tối', '', 'kage-no-jitsuryokusha-ni-naritakute-2nd-season', 'Mùa 2 bộ anime Ta Muốn Trở Thành Chúa Tể Bóng Tối', 'kage-no-jitsuryokusha-ni-naritakute-2nd-season', '', '', '', '', ''),
(54, 1, 'Tokyo Revengers: Tenjiku-hen', '<p>M&ugrave;a thứ 3 của anime Tokyo Revengers</p>', 'Mùa thứ 3 của anime Tokyo Revengers', '', 'tokyo-revengers-tenjiku-hen', 'Mùa thứ 3 của anime Tokyo Revengers', 'tokyo-revengers-tenjiku-hen', '', '', '', '', ''),
(55, 1, 'Tokyo Revengers Live Action', '<p>Hanagaki Takemichi rỗi việc sống trong một căn hộ tồi t&agrave;n, c&oacute; c&ocirc;ng việc khốn khổ v&agrave; bị t&ecirc;n sếp chế giễu. V&agrave;o một ng&agrave;y khi đang coi thời sự, Takemichi ph&aacute;t hiện Tachibana Hinata &ndash; c&ocirc; bạn g&aacute;i cũ duy nhất trong cuộc đời cậu hồi học trung học, đ&atilde; bị băng đảng Tokyo Manji giết chết. Tưởng chừng như hiện tại sẽ l&agrave; địa ngục trần gian m&atilde;i n&agrave;y, thế nhưng cậu bỗng c&oacute; cơ hội trở về qu&aacute; khứ 10 năm trước v&agrave;o những th&aacute;ng ng&agrave;y trung học. Hanagaki Takemichi quyết t&acirc;m thay đổi tương lai cứu sống Hinata bằng một c&aacute;ch duy nhất ch&iacute;nh l&agrave; giải t&aacute;n Tokyo Manji!!!</p>', 'Hanagaki Takemichi rỗi việc sống trong một căn hộ tồi tàn, có công việc khốn khổ và bị tên sếp chế giễu. Vào một ngày khi đang coi thời sự, Takemichi phát hiện Tachibana Hinata – cô bạn gái cũ duy nhất trong cuộc đời cậu hồi học trung học, đã bị băng đảng Tokyo Manji giết chết. Tưởng chừng như hiện tại sẽ là địa ngục trần gian mãi này, thế nhưng cậu bỗng có cơ hội trở về quá khứ 10 năm trước vào những tháng ngày trung học. Hanagaki Takemichi quyết tâm thay đổi tương lai cứu sống Hinata bằng một cách duy nhất chính là giải tán Tokyo Manji!!!', '', 'tokyo-revengers-live-action', 'Hanagaki Takemichi rỗi việc sống trong một căn hộ tồi tàn, có công việc khốn khổ và bị tên sếp chế giễu. Vào một ngày khi đang coi thời sự, Takemichi phát hiện Tachibana Hinata – cô bạn gái cũ duy nhấ...', 'tokyo-revengers-live-action', '', '', '', '', ''),
(56, 1, 'Migi to Dali', '<p>Một Con c&ograve; đ&atilde; đưa một thi&ecirc;n thần v&agrave;o cuộc đời của một cặp vợ chồng trung ni&ecirc;n kh&ocirc;ng c&oacute; con. Cha mẹ anh rất tốt bụng, nh&agrave; của họ sang trọng v&agrave; những bữa ăn rất ngon, nhưng để tiếp tục tận hưởng niềm hạnh ph&uacute;c n&agrave;y, Hitori phải giấu gia đ&igrave;nh m&igrave;nh một sự thật n&agrave;o đ&oacute;...</p>', 'Một Con cò đã đưa một thiên thần vào cuộc đời của một cặp vợ chồng trung niên không có con. Cha mẹ anh rất tốt bụng, nhà của họ sang trọng và những bữa ăn rất ngon, nhưng để tiếp tục tận hưởng niềm hạnh phúc này, Hitori phải giấu gia đình mình một sự thật nào đó...', '', 'migi-to-dali', 'Một Con cò đã đưa một thiên thần vào cuộc đời của một cặp vợ chồng trung niên không có con. Cha mẹ anh rất tốt bụng, nhà của họ sang trọng và những bữa ăn rất ngon, nhưng để tiếp tục tận hưởng niềm hạ...', 'migi-to-dali', '', '', '', '', ''),
(57, 1, 'Spy x Family Season 2', '<p>M&ugrave;a thứ hai của Gia Đ&igrave;nh Điệp Vi&ecirc;n.</p>', 'Mùa thứ hai của Gia Đình Điệp Viên.', '', 'spy-x-family-season-2', 'Mùa thứ hai của Gia Đình Điệp Viên.', 'spy-x-family-season-2', '', '', '', '', ''),
(58, 1, 'Kamonohashi Ron no Kindan Suiri', '<p>C&acirc;u chuyện xoay quanh anh ch&agrave;ng th&aacute;m tử &ldquo;đi&ecirc;n&rdquo; KAMONOHASHI Ron v&agrave; thanh tra mới v&agrave;o ng&agrave;nh ISSHIKI Totomaru. Từng l&agrave; một th&aacute;m tử nổi tiếng, thế nhưng Ron lại quyết định ở ẩn v&agrave; kh&ocirc;ng tham gia ph&aacute; &aacute;n ch&iacute;nh v&igrave; vậy, nhiều người đ&atilde; đồn rằng anh ta l&agrave; một ch&agrave;ng th&aacute;m tử đi&ecirc;n rồ.</p>', 'Câu chuyện xoay quanh anh chàng thám tử “điên” KAMONOHASHI Ron và thanh tra mới vào ngành ISSHIKI Totomaru. Từng là một thám tử nổi tiếng, thế nhưng Ron lại quyết định ở ẩn và không tham gia phá án chính vì vậy, nhiều người đã đồn rằng anh ta là một chàng thám tử điên rồ.', '', 'kamonohashi-ron-no-kindan-suiri', 'Câu chuyện xoay quanh anh chàng thám tử “điên” KAMONOHASHI Ron và thanh tra mới vào ngành ISSHIKI Totomaru. Từng là một thám tử nổi tiếng, thế nhưng Ron lại quyết định ở ẩn và không tham gia phá án ch...', 'kamonohashi-ron-no-kindan-suiri', '', '', '', '', ''),
(59, 1, 'Zom 100: Zombie ni Naru made ni Shitai 100 no Koto', '<p>Ban đầu, Akira Tendo l&agrave; một ch&agrave;ng trai trẻ mơ mộng v&agrave; đầy nhiệt huyết. Sau ba năm l&agrave;m việc cực nhọc trong một c&ocirc;ng việc thấp h&egrave;n, anh bị biến th&agrave;nh một người đ&agrave;n &ocirc;ng l&agrave;m việc như chiếc m&aacute;y v&agrave; mất hết kh&aacute;t vọng sinh tồn. Akira ph&aacute;t hiện ra th&agrave;nh phố bị t&agrave;n ph&aacute; bởi th&acirc;y ma khi anh đến văn ph&ograve;ng quản l&yacute; để trả v&eacute; đậu xe v&agrave;o một buổi s&aacute;ng. Ngay cả &ocirc;ng chủ, Otori, người m&agrave; Akira đ&atilde; y&ecirc;u từ c&aacute;i nh&igrave;n đầu ti&ecirc;n, cũng trở th&agrave;nh một th&acirc;y ma, đ&oacute; l&agrave; khi c&acirc;u chuyện về người đ&agrave;n &ocirc;ng được t&aacute;i sinh th&agrave;nh một zombie bắt đầu!</p>', 'Ban đầu, Akira Tendo là một chàng trai trẻ mơ mộng và đầy nhiệt huyết. Sau ba năm làm việc cực nhọc trong một công việc thấp hèn, anh bị biến thành một người đàn ông làm việc như chiếc máy và mất hết khát vọng sinh tồn. Akira phát hiện ra thành phố bị tàn phá bởi thây ma khi anh đến văn phòng quản lý để trả vé đậu xe vào một buổi sáng. Ngay cả ông chủ, Otori, người mà Akira đã yêu từ cái nhìn đầu tiên, cũng trở thành một thây ma, đó là khi câu chuyện về người đàn ông được tái sinh thành một zombie bắt đầu!', '', 'zom-100-zombie-ni-naru-made-ni-shitai-100-no-koto', 'Ban đầu, Akira Tendo là một chàng trai trẻ mơ mộng và đầy nhiệt huyết. Sau ba năm làm việc cực nhọc trong một công việc thấp hèn, anh bị biến thành một người đàn ông làm việc như chiếc máy và mất hết...', 'zom-100-zombie-ni-naru-made-ni-shitai-100-no-koto', '', '', '', '', ''),
(60, 1, 'Kikansha no Mahou wa Tokubetsu desu', '<p>Thế giới đứng trước bờ vực diệt vong sau cuộc chiến t&agrave;n khốc k&eacute;o d&agrave;i 10 năm trong \"m&ecirc; cung b&oacute;ng tối\". Desir Arman l&agrave; một trong những ph&aacute;p sư l&agrave;nh nghề cuối c&ugrave;ng c&ograve;n s&oacute;t lại, nhưng ngay cả anh ta cũng kh&ocirc;ng phải l&agrave; đối thủ của kẻ th&ugrave; gh&ecirc; gớm đang đe dọa sự tồn tại của nh&acirc;n loại. Ngay khi anh ấy chắc chắn rằng ng&agrave;y tận thế đ&atilde; đến, anh ấy được gửi ngược thời gian về những ng&agrave;y đầu học ph&eacute;p thuật tại Học viện Hebrion danh gi&aacute;! Với cơ hội hiếm hoi thứ hai n&agrave;y, Desir quyết t&acirc;m cứu kh&ocirc;ng chỉ bản th&acirc;n m&agrave; c&ograve;n cả những người bạn v&agrave; đồng đội m&agrave; anh từng đ&aacute;nh mất. Được trang bị kiến ​​thức về những g&igrave; tương lai của họ nắm giữ, những nỗ lực của anh ấy c&oacute; thể tạo ra sự kh&aacute;c biệt hay tất cả họ đều cam chịu sống lại c&ugrave;ng một số phận khủng khiếp? Dựa tr&ecirc;n tiểu thuyết ăn kh&aacute;ch.</p>', 'Thế giới đứng trước bờ vực diệt vong sau cuộc chiến tàn khốc kéo dài 10 năm trong \"mê cung bóng tối\". Desir Arman là một trong những pháp sư lành nghề cuối cùng còn sót lại, nhưng ngay cả anh ta cũng không phải là đối thủ của kẻ thù ghê gớm đang đe dọa sự tồn tại của nhân loại. Ngay khi anh ấy chắc chắn rằng ngày tận thế đã đến, anh ấy được gửi ngược thời gian về những ngày đầu học phép thuật tại Học viện Hebrion danh giá! Với cơ hội hiếm hoi thứ hai này, Desir quyết tâm cứu không chỉ bản thân mà còn cả những người bạn và đồng đội mà anh từng đánh mất. Được trang bị kiến ​​thức về những gì tương lai của họ nắm giữ, những nỗ lực của anh ấy có thể tạo ra sự khác biệt hay tất cả họ đều cam chịu sống lại cùng một số phận khủng khiếp? Dựa trên tiểu thuyết ăn khách.', '', 'kikansha-no-mahou-wa-tokubetsu-desu', 'Thế giới đứng trước bờ vực diệt vong sau cuộc chiến tàn khốc kéo dài 10 năm trong \"mê cung bóng tối\". Desir Arman là một trong những pháp sư lành nghề cuối cùng còn sót lại, nhưng ngay cả anh ta cũng...', 'kikansha-no-mahou-wa-tokubetsu-desu', '', '', '', '', ''),
(61, 1, 'Kimi no Koto ga Daidaidaidaidaisuki na 100-nin no Kanojo', '<p>Sau khi tốt nghiệp cấp hai, Rentarou Aijou đ&atilde; tỏ t&igrave;nh với c&ocirc; g&aacute;i m&igrave;nh y&ecirc;u. Thật kh&ocirc;ng may, anh ta bị từ chối, đ&acirc;y l&agrave; lần bị từ chối thứ 100 li&ecirc;n tiếp. Trải qua hết nỗi đau n&agrave;y đến nỗi đau kh&aacute;c, anh đến một ng&ocirc;i đền mai mối v&agrave; cầu nguyện với hy vọng cuối c&ugrave;ng sẽ c&oacute; được một c&ocirc; bạn g&aacute;i ở trường trung học. Đột nhi&ecirc;n, vị thần của ng&ocirc;i đền xuất hiện, hứa với Rentarou rằng cậu sẽ gặp một trăm người bạn t&acirc;m giao ở trường trung học.</p>\r\n<p>Mặc d&ugrave; ban đầu c&ograve;n ho&agrave;i nghi, Rentarou nhanh ch&oacute;ng nhận ra sự thật đằng sau những lời của vị thần khi hai người bạn t&acirc;m giao của anh&mdash;Hakari Hanazono v&agrave; Karane Inda&mdash;th&uacute; nhận với anh v&agrave;o c&ugrave;ng ng&agrave;y họ gặp anh. Tuy nhi&ecirc;n, c&oacute; một chi tiết m&agrave; vị thần đ&atilde; qu&ecirc;n n&oacute;i với Rentarou: nếu bất kỳ người bạn t&acirc;m hồn n&agrave;o của anh ta kh&ocirc;ng c&oacute; mối quan hệ với anh ta, họ sẽ chết. B&acirc;y giờ bị mắc kẹt trong vấn đề sinh tử, Rentarou quyết định hẹn h&ograve; với tất cả những người bạn t&acirc;m giao của m&igrave;nh.</p>\r\n<p>Với một tr&aacute;i tim lớn đến mức c&oacute; thể chia sẻ cho h&agrave;ng trăm người bạn g&aacute;i, Rentarou tận dụng tối đa cuộc sống trung học kh&ocirc;ng lường trước được của m&igrave;nh, với gia đ&igrave;nh Rentarou ng&agrave;y c&agrave;ng lớn mạnh!</p>', 'Sau khi tốt nghiệp cấp hai, Rentarou Aijou đã tỏ tình với cô gái mình yêu. Thật không may, anh ta bị từ chối, đây là lần bị từ chối thứ 100 liên tiếp. Trải qua hết nỗi đau này đến nỗi đau khác, anh đến một ngôi đền mai mối và cầu nguyện với hy vọng cuối cùng sẽ có được một cô bạn gái ở trường trung học. Đột nhiên, vị thần của ngôi đền xuất hiện, hứa với Rentarou rằng cậu sẽ gặp một trăm người bạn tâm giao ở trường trung học.\r\nMặc dù ban đầu còn hoài nghi, Rentarou nhanh chóng nhận ra sự thật đằng sau những lời của vị thần khi hai người bạn tâm giao của anh—Hakari Hanazono và Karane Inda—thú nhận với anh vào cùng ngày họ gặp anh. Tuy nhiên, có một chi tiết mà vị thần đã quên nói với Rentarou: nếu bất kỳ người bạn tâm hồn nào của anh ta không có mối quan hệ với anh ta, họ sẽ chết. Bây giờ bị mắc kẹt trong vấn đề sinh tử, Rentarou quyết định hẹn hò với tất cả những người bạn tâm giao của mình.\r\nVới một trái tim lớn đến mức có thể chia sẻ cho hàng trăm người bạn gái, Rentarou tận dụng tối đa cuộc sống trung học không lường trước được của mình, với gia đình Rentarou ngày càng lớn mạnh!', '', 'kimi-no-koto-ga-daidaidaidaidaisuki-na-100-nin-no-kanojo', 'Sau khi tốt nghiệp cấp hai, Rentarou Aijou đã tỏ tình với cô gái mình yêu. Thật không may, anh ta bị từ chối, đây là lần bị từ chối thứ 100 liên tiếp. Trải qua hết nỗi đau này đến nỗi đau khác, anh đế...', 'kimi-no-koto-ga-daidaidaidaidaisuki-na-100-nin-no-kanojo', '', '', '', '', ''),
(62, 1, 'Thám Tử Lừng Danh Conan 26: Tàu Ngầm Sắt Màu Đen', '<p>Địa điểm lần n&agrave;y được đặt ở v&ugrave;ng biển gần đảo Hachijo-jima, Tokyo. C&aacute;c kỹ sư từ khắp nơi tr&ecirc;n thế giới đ&atilde; tập hợp để vận h&agrave;nh to&agrave;n diện \"Phao Th&aacute;i B&igrave;nh Dương\", một cơ sở ngo&agrave;i khơi để kết nối c&aacute;c camera an ninh thuộc sở hữu của lực lượng cảnh s&aacute;t tr&ecirc;n to&agrave;n thế giới. Một thử nghiệm về một \"c&ocirc;ng nghệ mới\" nhất định dựa tr&ecirc;n hệ thống nhận dạng khu&ocirc;n mặt đang được tiến h&agrave;nh ở đ&oacute;. Trong khi đ&oacute;, Conan v&agrave; Đội th&aacute;m tử nh&iacute; đến thăm Hachijo-jima theo lời mời của Sonoko v&agrave; nhận được một cuộc điện thoại từ Subaru Okiya th&ocirc;ng b&aacute;o rằng một nh&acirc;n vi&ecirc;n Europol đ&atilde; bị s&aacute;t hại ở Đức bởi Jin của Tổ chức &Aacute;o đen. Conan lo lắng, lẻn v&agrave;o cơ sở v&agrave; ph&aacute;t hiện ra rằng một nữ kỹ sư đ&atilde; bị Tổ chức &Aacute;o đen bắt c&oacute;c...! Hơn nữa, một ổ USB chứa một số th&ocirc;ng tin nhất định m&agrave; c&ocirc; ấy sở hữu lại lọt v&agrave;o tay tổ chức... Một b&oacute;ng đen cũng len lỏi v&agrave;o Ai Haibara...</p>', 'Địa điểm lần này được đặt ở vùng biển gần đảo Hachijo-jima, Tokyo. Các kỹ sư từ khắp nơi trên thế giới đã tập hợp để vận hành toàn diện \"Phao Thái Bình Dương\", một cơ sở ngoài khơi để kết nối các camera an ninh thuộc sở hữu của lực lượng cảnh sát trên toàn thế giới. Một thử nghiệm về một \"công nghệ mới\" nhất định dựa trên hệ thống nhận dạng khuôn mặt đang được tiến hành ở đó. Trong khi đó, Conan và Đội thám tử nhí đến thăm Hachijo-jima theo lời mời của Sonoko và nhận được một cuộc điện thoại từ Subaru Okiya thông báo rằng một nhân viên Europol đã bị sát hại ở Đức bởi Jin của Tổ chức Áo đen. Conan lo lắng, lẻn vào cơ sở và phát hiện ra rằng một nữ kỹ sư đã bị Tổ chức Áo đen bắt cóc...! Hơn nữa, một ổ USB chứa một số thông tin nhất định mà cô ấy sở hữu lại lọt vào tay tổ chức... Một bóng đen cũng len lỏi vào Ai Haibara...', '', 'tham-tu-lung-danh-conan-26-tau-ngam-sat-mau-den', 'Địa điểm lần này được đặt ở vùng biển gần đảo Hachijo-jima, Tokyo. Các kỹ sư từ khắp nơi trên thế giới đã tập hợp để vận hành toàn diện \"Phao Thái Bình Dương\", một cơ sở ngoài khơi để kết nối các came...', 'tham-tu-lung-danh-conan-26-tau-ngam-sat-mau-den', '', '', '', '', ''),
(63, 1, 'Detective Conan Movie 24: Hiiro no Dangan', '<p>Movie 24: Vi&ecirc;n Đạn Đỏ Tươi&nbsp; xoay quanh c&acirc;u chuyện về gia đ&igrave;nh của Akai, người c&oacute; mối quan hệ r&agrave;ng buộc với tổ chức &aacute;o đen. L&uacute;c n&agrave;y Nhật Bản tổ chức kỷ niệm Thế vận hội thể thao thế giới, cũng l&agrave; l&uacute;c chuyến t&agrave;u ch&acirc;n kh&ocirc;ng \'Bullet Nhật Bản\' được ra mắt. Tuy nhi&ecirc;n trong buổi tiệc họp mặt của c&aacute;c nh&agrave; t&agrave;i trợ lớn, một vị gi&aacute;m đốc điều h&agrave;nh đ&atilde; bị bắt c&oacute;c. Conan lần theo manh mối để lại, suy luận nhiều đầu mối li&ecirc;n quan đến vụ bắt c&oacute;c h&agrave;ng loạt v&agrave;o 15 năm trước ở Boston, v&agrave; hiển nhi&ecirc;n c&oacute; li&ecirc;n quan đến gia đ&igrave;nh Akai</p>', 'Movie 24: Viên Đạn Đỏ Tươi  xoay quanh câu chuyện về gia đình của Akai, người có mối quan hệ ràng buộc với tổ chức áo đen. Lúc này Nhật Bản tổ chức kỷ niệm Thế vận hội thể thao thế giới, cũng là lúc chuyến tàu chân không \'Bullet Nhật Bản\' được ra mắt. Tuy nhiên trong buổi tiệc họp mặt của các nhà tài trợ lớn, một vị giám đốc điều hành đã bị bắt cóc. Conan lần theo manh mối để lại, suy luận nhiều đầu mối liên quan đến vụ bắt cóc hàng loạt vào 15 năm trước ở Boston, và hiển nhiên có liên quan đến gia đình Akai', '', 'detective-conan-movie-24-hiiro-no-dangan', 'Movie 24: Viên Đạn Đỏ Tươi  xoay quanh câu chuyện về gia đình của Akai, người có mối quan hệ ràng buộc với tổ chức áo đen. Lúc này Nhật Bản tổ chức kỷ niệm Thế vận hội thể thao thế giới, cũng là lúc c...', 'detective-conan-movie-24-hiiro-no-dangan', '', '', '', '', ''),
(64, 1, 'Detective Conan: Haibara Ai Monogatari - Kurogane no Mystery Train', '<p>Bộ phim sẽ tập trung v&agrave;o qu&aacute; khứ của Ai Haibara v&agrave; sẽ dựng lại phần Chuyến t&agrave;u b&iacute; ẩn từ anime truyền h&igrave;nh, nơi Haibara v&agrave; Conan gặp nhau lần đầu ti&ecirc;n. Bộ phim cũng sẽ bao gồm c&aacute;c cảnh trong phim Kurogane no Submarine ( T&agrave;u ngầm sắt đen ).</p>', 'Bộ phim sẽ tập trung vào quá khứ của Ai Haibara và sẽ dựng lại phần Chuyến tàu bí ẩn từ anime truyền hình, nơi Haibara và Conan gặp nhau lần đầu tiên. Bộ phim cũng sẽ bao gồm các cảnh trong phim Kurogane no Submarine ( Tàu ngầm sắt đen ).', '', 'detective-conan-haibara-ai-monogatari-kurogane-no-mystery-train', 'Bộ phim sẽ tập trung vào quá khứ của Ai Haibara và sẽ dựng lại phần Chuyến tàu bí ẩn từ anime truyền hình, nơi Haibara và Conan gặp nhau lần đầu tiên. Bộ phim cũng sẽ bao gồm các cảnh trong phim Kurog...', 'detective-conan-haibara-ai-monogatari-kurogane-no-mystery-train', '', '', '', '', ''),
(68, 1, 'Jujutsu Kaisen (TV)', '<p>V&igrave; một l&yacute; do kỳ lạ n&agrave;o đ&oacute;, Yuji Itadori, mặc d&ugrave; với thể chất ho&agrave;n hảo nhưng anh lại đ&acirc;m đầu v&agrave;o tham gia CLB Huyền B&iacute;. Tuy nhi&ecirc;n, họ đ&atilde; sớm ph&aacute;t hiện ra l&agrave; những c&acirc;u chuyện huyền b&iacute; ho&agrave;n to&agrave;n c&oacute; thật khi c&aacute;c th&agrave;nh vi&ecirc;n trong CLB lần lượt bị tấn c&ocirc;ng! Trong khi đ&oacute;, Megumi Fushiguro &ldquo;b&iacute; ẩn&rdquo; lại đang truy t&igrave;m một đối tượng bị nguyền rủa cấp đặc biệt v&agrave; cuộc t&igrave;m kiếm n&agrave;y đ&atilde; đưa nh&oacute;m bạn đến Itadori&hellip;</p>', 'Vì một lý do kỳ lạ nào đó, Yuji Itadori, mặc dù với thể chất hoàn hảo nhưng anh lại đâm đầu vào tham gia CLB Huyền Bí. Tuy nhiên, họ đã sớm phát hiện ra là những câu chuyện huyền bí hoàn toàn có thật khi các thành viên trong CLB lần lượt bị tấn công! Trong khi đó, Megumi Fushiguro “bí ẩn” lại đang truy tìm một đối tượng bị nguyền rủa cấp đặc biệt và cuộc tìm kiếm này đã đưa nhóm bạn đến Itadori…', '', 'jujutsu-kaisen-tv', 'Vì một lý do kỳ lạ nào đó, Yuji Itadori, mặc dù với thể chất hoàn hảo nhưng anh lại đâm đầu vào tham gia CLB Huyền Bí. Tuy nhiên, họ đã sớm phát hiện ra là những câu chuyện huyền bí hoàn toàn có thật...', 'jujutsu-kaisen-tv', '', '', '', '', ''),
(67, 1, 'Shuumatsu no Walkure', '<p>Lấy bối cảnh ở thi&ecirc;n giới, nơi c&aacute;c vị thần của tất cả c&aacute;c nền văn h&oacute;a v&agrave; t&ocirc;n gi&aacute;o tr&ecirc;n thế giới đều tề tựu lại dưới sự đứng đầu của thần Zeus. Cứ 1000 năm, c&aacute;c vị thần sẽ họp mặt tại cung điện Valhala để b&agrave;n về chuyện tiếp tục cho con người sống tiếp hay sẽ đặt dấu chấm hết cho tất cả. Sau h&agrave;ng ng&agrave;n năm dẫn dắt lo&agrave;i người ph&aacute;t triển, c&aacute;c vị thần cảm thấy ch&uacute;ng đang ng&agrave;y c&agrave;ng tha h&oacute;a v&agrave; trở n&ecirc;n xấu x&iacute;. Tất cả c&aacute;c vị thần đều đồng thuận sẽ kết th&uacute;c sự sống của lo&agrave;i người. Ngay l&uacute;c quyết định sắp được đưa ra, Brunhild, một trong 13 Valkyrie trong thần thoại Bắc &Acirc;u, đ&atilde; l&ecirc;n tiếng k&ecirc;u gọi một trận Ragnarok giữa người v&agrave; thần với mục ti&ecirc;u cứu sống nh&acirc;n loại. Theo điều luật của Valhala, phe người v&agrave; phe thần sẽ cử ra 13 đại diện mạnh nhất để thi đấu 1 đối 1 với nhau, b&ecirc;n n&agrave;o đạt được 7 trận thắng sẽ gi&agrave;nh lấy thắng lợi chung cuộc. Đ&acirc;y ch&iacute;nh l&agrave; thể thức được c&aacute;c thần đưa ra để tạo cơ hội cho nh&acirc;n loại.</p>', '', '', 'shuumatsu-no-walkure', 'Lấy bối cảnh ở thiên giới, nơi các vị thần của tất cả các nền văn hóa và tôn giáo trên thế giới đều tề tựu lại dưới sự đứng đầu của thần Zeus. Cứ 1000 năm, các vị thần sẽ họp mặt tại cung điện Valhala...', 'shuumatsu-no-walkure', '', '', '', '', ''),
(69, 1, 'Jujutsu Kaisen 2nd Season', '<p>M&ugrave;a thứ hai của Jujutsu Kaisen .&nbsp;</p>', 'Mùa thứ hai của Jujutsu Kaisen . ', '', 'jujutsu-kaisen-2nd-season', 'Mùa thứ hai của Jujutsu Kaisen . ', 'jujutsu-kaisen-2nd-season', '', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `description_short`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `custom_alt`, `custom_h1`, `custom_h2`, `custom_imgtitle`, `custom_title`) VALUES
(70, 1, 'Dead Mount Death Play', '<p>Trong một thế giới giả tưởng xa x&ocirc;i, người anh h&ugrave;ng huyền thoại đảm nhận một vị thần x&aacute;c chết gọi hồn. Tuy nhi&ecirc;n, vị thần gọi hồn đ&atilde; sử dụng con &aacute;t chủ b&agrave;i trong tay &aacute;o của m&igrave;nh trong những gi&acirc;y ph&uacute;t cuối c&ugrave;ng của trận quyết đấu ho&agrave;nh tr&aacute;ng. Anh ta sử dụng ph&eacute;p thuật t&aacute;i sinh. Do đ&oacute;, người anh h&ugrave;ng đ&atilde; đ&aacute;nh bại vị thần gọi hồn, hoặc anh ta nghĩ vậy. Ở một thế giới kh&aacute;c, một cậu b&eacute; t&ecirc;n Polka Shinoyama thức dậy với cảm gi&aacute;c kh&aacute;c thường. Trận chiến cổ xưa giữa thiện v&agrave; &aacute;c vừa diễn ra một c&aacute;ch kịch t&iacute;nh.</p>', 'Trong một thế giới giả tưởng xa xôi, người anh hùng huyền thoại đảm nhận một vị thần xác chết gọi hồn. Tuy nhiên, vị thần gọi hồn đã sử dụng con át chủ bài trong tay áo của mình trong những giây phút cuối cùng của trận quyết đấu hoành tráng. Anh ta sử dụng phép thuật tái sinh. Do đó, người anh hùng đã đánh bại vị thần gọi hồn, hoặc anh ta nghĩ vậy. Ở một thế giới khác, một cậu bé tên Polka Shinoyama thức dậy với cảm giác khác thường. Trận chiến cổ xưa giữa thiện và ác vừa diễn ra một cách kịch tính.', '', 'dead-mount-death-play', 'Trong một thế giới giả tưởng xa xôi, người anh hùng huyền thoại đảm nhận một vị thần xác chết gọi hồn. Tuy nhiên, vị thần gọi hồn đã sử dụng con át chủ bài trong tay áo của mình trong những giây phút...', 'dead-mount-death-play', '', '', '', '', ''),
(71, 1, 'Potion-danomi de Ikinobimasu!', '<p>Một ng&agrave;y nọ, người gi&aacute;m s&aacute;t phụ tr&aacute;ch tr&ocirc;ng chừng Tr&aacute;i đất đang chăm s&oacute;c một biến dạng, khi họ phạm sai lầm khiến Kaoru Nagase mất đi cơ thể ch&iacute;nh. Kh&ocirc;ng chỉ vậy, việc t&aacute;i sinh c&ocirc; ấy v&agrave;o một thế giới kh&aacute;c, k&eacute;m văn h&oacute;a hơn l&agrave; điều duy nhất họ c&oacute; thể đề nghị l&agrave;m cho c&ocirc; ấy. Kh&ocirc;ng phải l&agrave; người sẵn s&agrave;ng chấp nhận sự kiện n&agrave;y khi ngồi xuống, Kaoru đưa ra y&ecirc;u cầu: sức mạnh để tạo ra độc dược bất cứ l&uacute;c n&agrave;o c&ocirc; ấy muốn, với bất kỳ t&aacute;c dụng n&agrave;o c&ocirc; ấy muốn &mdash; v&agrave; n&oacute; cũng kh&ocirc;ng dừng lại ở đ&oacute;. C&ocirc; ấy y&ecirc;u cầu một Hộp vật phẩm ma thuật, khả năng hiểu v&agrave; n&oacute;i mọi ng&ocirc;n ngữ, cũng như cơ thể m&agrave; c&ocirc; ấy c&oacute; khi c&ograve;n l&agrave; một c&ocirc; g&aacute;i mười lăm tuổi. Sử dụng sức mạnh mới t&igrave;m thấy của m&igrave;nh, Kaoru phải cố gắng tạo dựng một cuộc sống ổn định cho ch&iacute;nh m&igrave;nh trong một thế giới ho&agrave;n to&agrave;n mới!</p>', 'Một ngày nọ, người giám sát phụ trách trông chừng Trái đất đang chăm sóc một biến dạng, khi họ phạm sai lầm khiến Kaoru Nagase mất đi cơ thể chính. Không chỉ vậy, việc tái sinh cô ấy vào một thế giới khác, kém văn hóa hơn là điều duy nhất họ có thể đề nghị làm cho cô ấy. Không phải là người sẵn sàng chấp nhận sự kiện này khi ngồi xuống, Kaoru đưa ra yêu cầu: sức mạnh để tạo ra độc dược bất cứ lúc nào cô ấy muốn, với bất kỳ tác dụng nào cô ấy muốn — và nó cũng không dừng lại ở đó. Cô ấy yêu cầu một Hộp vật phẩm ma thuật, khả năng hiểu và nói mọi ngôn ngữ, cũng như cơ thể mà cô ấy có khi còn là một cô gái mười lăm tuổi. Sử dụng sức mạnh mới tìm thấy của mình, Kaoru phải cố gắng tạo dựng một cuộc sống ổn định cho chính mình trong một thế giới hoàn toàn mới!', '', 'potion-danomi-de-ikinobimasu', 'Một ngày nọ, người giám sát phụ trách trông chừng Trái đất đang chăm sóc một biến dạng, khi họ phạm sai lầm khiến Kaoru Nagase mất đi cơ thể chính. Không chỉ vậy, việc tái sinh cô ấy vào một thế giới...', 'potion-danomi-de-ikinobimasu', '', '', '', '', ''),
(72, 1, 'Tearmoon Teikoku Monogatari: Dantoudai kara Hajimaru, Hime no Tensei Gyakuten Story', '<p>Bị bao quanh bởi những &aacute;nh mắt đầy th&ugrave; hận của người d&acirc;n, c&ocirc;ng ch&uacute;a &iacute;ch kỷ của Đế chế Tearmoon đ&atilde; sụp đổ, Mia, nh&igrave;n mặt trời đang chảy m&aacute;u lần cuối trước khi lưỡi m&aacute;y ch&eacute;m rơi xuống... Chỉ để tỉnh dậy trở th&agrave;nh một đứa trẻ mười hai tuổi ! Khi thời gian quay ngược lại v&agrave; cơ hội sống thứ hai rơi v&agrave;o l&ograve;ng c&ocirc;, c&ocirc; bắt đầu sửa chữa v&ocirc; số sai lầm đang ho&agrave;nh h&agrave;nh ở Đế chế ốm yếu. Tham nhũng quản trị? Kiểm tra. Rắc rối bi&ecirc;n giới? Kiểm tra. Thi&ecirc;n tai v&agrave; xung đột kinh tế? Kiểm tra. &Ocirc;i trời, c&oacute; vẻ như c&oacute; rất nhiều việc phải l&agrave;m. L&agrave;m việc chăm chỉ v&agrave; Mia kh&ocirc;ng trộn lẫn với nhau, v&igrave; vậy c&ocirc; ấy t&igrave;m kiếm sự gi&uacute;p đỡ của người kh&aacute;c, bắt đầu với người hầu g&aacute;i trung th&agrave;nh của c&ocirc; ấy, Anne, v&agrave; bộ trưởng t&agrave;i giỏi, Ludwig. C&ugrave;ng nhau, họ nỗ lực cả ng&agrave;y lẫn đ&ecirc;m để kh&ocirc;i phục Đế chế. Từng ch&uacute;t một, những nỗ lực kh&ocirc;ng mệt mỏi của họ bắt đầu thay đổi tiến tr&igrave;nh lịch sử, th&uacute;c đẩy to&agrave;n bộ lục địa hướng tới một tương lai mới. V&agrave; tại sao c&ocirc;ng ch&uacute;a &iacute;ch kỷ lại thay l&ograve;ng đổi dạ? Đơn giản - c&ocirc; ấy kh&ocirc;ng l&agrave;m thế. C&ocirc; ấy chỉ sợ m&aacute;y ch&eacute;m th&ocirc;i. Ch&uacute;ng đau như b&uacute;a bổ, v&agrave; Mia gh&eacute;t đau đớn hơn c&ocirc;ng việc.</p>', 'Bị bao quanh bởi những ánh mắt đầy thù hận của người dân, công chúa ích kỷ của Đế chế Tearmoon đã sụp đổ, Mia, nhìn mặt trời đang chảy máu lần cuối trước khi lưỡi máy chém rơi xuống... Chỉ để tỉnh dậy trở thành một đứa trẻ mười hai tuổi ! Khi thời gian quay ngược lại và cơ hội sống thứ hai rơi vào lòng cô, cô bắt đầu sửa chữa vô số sai lầm đang hoành hành ở Đế chế ốm yếu. Tham nhũng quản trị? Kiểm tra. Rắc rối biên giới? Kiểm tra. Thiên tai và xung đột kinh tế? Kiểm tra. Ôi trời, có vẻ như có rất nhiều việc phải làm. Làm việc chăm chỉ và Mia không trộn lẫn với nhau, vì vậy cô ấy tìm kiếm sự giúp đỡ của người khác, bắt đầu với người hầu gái trung thành của cô ấy, Anne, và bộ trưởng tài giỏi, Ludwig. Cùng nhau, họ nỗ lực cả ngày lẫn đêm để khôi phục Đế chế. Từng chút một, những nỗ lực không mệt mỏi của họ bắt đầu thay đổi tiến trình lịch sử, thúc đẩy toàn bộ lục địa hướng tới một tương lai mới. Và tại sao công chúa ích kỷ lại thay lòng đổi dạ? Đơn giản - cô ấy không làm thế. Cô ấy chỉ sợ máy chém thôi. Chúng đau như búa bổ, và Mia ghét đau đớn hơn công việc.', '', 'tearmoon-teikoku-monogatari-dantoudai-kara-hajimaru-hime-no-tensei-gyakuten-story', 'Bị bao quanh bởi những ánh mắt đầy thù hận của người dân, công chúa ích kỷ của Đế chế Tearmoon đã sụp đổ, Mia, nhìn mặt trời đang chảy máu lần cuối trước khi lưỡi máy chém rơi xuống... Chỉ để tỉnh dậy...', 'tearmoon-teikoku-monogatari-dantoudai-kara-hajimaru-hime-no-tensei-gyakuten-story', '', '', '', '', ''),
(73, 1, 'Mashle', '<p>Ma Ph&aacute;p Giới l&agrave; thế giới m&agrave; ph&aacute;p thuật ngự trị trong đời sống. Kẻ n&agrave;o c&oacute; ma lực c&agrave;ng cao th&igrave; c&agrave;ng c&oacute; địa vị x&atilde; hội, v&agrave; trong đ&oacute;, cơ quan cao nhất l&agrave; Cục Ph&aacute;p Thuật. Tuy nhi&ecirc;n, giữa rừng ph&ugrave; thủy ph&aacute;p sư th&igrave; lại lọt ra một Mash Burnedead kh&ocirc;ng c&oacute; ma lực trong người. Nhưng thay v&igrave; d&ugrave;ng ph&eacute;p để thăng tiến, cậu chọn d&ugrave;ng nắm đấm.</p>', 'Ma Pháp Giới là thế giới mà pháp thuật ngự trị trong đời sống. Kẻ nào có ma lực càng cao thì càng có địa vị xã hội, và trong đó, cơ quan cao nhất là Cục Pháp Thuật. Tuy nhiên, giữa rừng phù thủy pháp sư thì lại lọt ra một Mash Burnedead không có ma lực trong người. Nhưng thay vì dùng phép để thăng tiến, cậu chọn dùng nắm đấm.', '', 'mashle', 'Ma Pháp Giới là thế giới mà pháp thuật ngự trị trong đời sống. Kẻ nào có ma lực càng cao thì càng có địa vị xã hội, và trong đó, cơ quan cao nhất là Cục Pháp Thuật. Tuy nhiên, giữa rừng phù thủy pháp...', 'mashle', '', '', '', '', ''),
(74, 1, 'Kimetsu no Yaiba Movie: Mugen Ressha-hen [Bluray]', '<p>Tr&ecirc;n đường điều tra sự mất t&iacute;ch của c&aacute;c Kiếm Sĩ thuộc Đội Diệt Quỷ, Tanjiro v&agrave; c&aacute;c đồng đội c&ugrave;ng Vi&ecirc;m Trụ Rengoku rơi v&agrave;o Huyết Quỷ Thuật ảo mộng của Quỷ Hạ Huyền Enmu. Cả bọn phải hiệp lực để bảo to&agrave;n t&iacute;nh mạng cho 200 h&agrave;nh kh&aacute;ch tr&ecirc;n chuyến t&agrave;u V&ocirc; Tận. Nhờ sự hi sinh của Vi&ecirc;m Trụ Rengoku, Quỷ Hạ Huyền đ&atilde; bị đ&aacute;nh bại v&agrave; mọi người được sống s&oacute;t</p>', 'Trên đường điều tra sự mất tích của các Kiếm Sĩ thuộc Đội Diệt Quỷ, Tanjiro và các đồng đội cùng Viêm Trụ Rengoku rơi vào Huyết Quỷ Thuật ảo mộng của Quỷ Hạ Huyền Enmu. Cả bọn phải hiệp lực để bảo toàn tính mạng cho 200 hành khách trên chuyến tàu Vô Tận. Nhờ sự hi sinh của Viêm Trụ Rengoku, Quỷ Hạ Huyền đã bị đánh bại và mọi người được sống sót', '', 'kimetsu-no-yaiba-movie-mugen-ressha-hen-bluray', 'Trên đường điều tra sự mất tích của các Kiếm Sĩ thuộc Đội Diệt Quỷ, Tanjiro và các đồng đội cùng Viêm Trụ Rengoku rơi vào Huyết Quỷ Thuật ảo mộng của Quỷ Hạ Huyền Enmu. Cả bọn phải hiệp lực để bảo toà...', 'kimetsu-no-yaiba-movie-mugen-ressha-hen-bluray', '', '', '', '', ''),
(75, 1, 'Kimetsu no Yaiba', '<p>V&agrave;o thời xa xưa, c&oacute; một truyền thuyết về những con quỷ ăn thịt người lu&ocirc;n l&atilde;ng v&atilde;ng trong c&aacute;nh rừng s&acirc;u. V&igrave; điều n&agrave;y, người d&acirc;n trong l&agrave;ng kh&ocirc;ng bao giờ đi ra ngo&agrave;i v&agrave;o trời tối. Truyền thuyến cũng kể rằng c&oacute; một S&aacute;t Quỷ Nh&acirc;n lu&ocirc;n xuất hiện v&agrave;o ban đ&ecirc;m để ti&ecirc;u diệt những con quỷ kh&aacute;t m&aacute;u n&agrave;y. Đối với ch&agrave;ng trai trẻ Tanjiro, c&acirc;u chuyện d&acirc;n gian ấy đ&atilde; trở th&agrave;nh hiện thực cay đắng m&agrave; cậu phải hứng chịu... Sau khi cha cậu qua đời, Tanjiro lu&ocirc;n cố gắng hết sức để trở th&agrave;nh trụ cột trong gia đ&igrave;nh. D&ugrave; cuộc sống vất vả, cực khổ, những gia đ&igrave;nh của cậu vẫn lu&ocirc;n ngập tr&agrave;n hạnh ph&uacute;c. Nhưng niềm hạnh ph&uacute;c ấy cũngkh&ocirc;ng k&eacute;o d&agrave;i l&acirc;u được. Một ng&agrave;y nọ, khi Tanjiro trở về, cậu ph&aacute;t hiện gia đ&igrave;nh m&igrave;nh đ&atilde; bị s&aacute;t hại d&atilde; man, v&agrave; chỉ c&oacute; một người duy nhất sống s&oacute;t, đ&oacute; l&agrave; em g&aacute;i Nezuko của cậu. Nhưng bi kịch thay, Nezuko đ&atilde; trở th&agrave;nh con quỷ đ&aacute;ng sợ. Tuy nhi&ecirc;n, c&ocirc; vẫn c&ograve;n giữ một ch&uacute;t nh&acirc;n t&iacute;nh. Đ&oacute; l&agrave; thời điểm bắt đầu cuộc chiến đơn độc của Tanjiro, ti&ecirc;u diệt quỷ v&agrave; t&igrave;m c&aacute;ch biến em g&aacute;i m&igrave;nh trở lại l&agrave;m người.</p>', 'Vào thời xa xưa, có một truyền thuyết về những con quỷ ăn thịt người luôn lãng vãng trong cánh rừng sâu. Vì điều này, người dân trong làng không bao giờ đi ra ngoài vào trời tối. Truyền thuyến cũng kể rằng có một Sát Quỷ Nhân luôn xuất hiện vào ban đêm để tiêu diệt những con quỷ khát máu này. Đối với chàng trai trẻ Tanjiro, câu chuyện dân gian ấy đã trở thành hiện thực cay đắng mà cậu phải hứng chịu... Sau khi cha cậu qua đời, Tanjiro luôn cố gắng hết sức để trở thành trụ cột trong gia đình. Dù cuộc sống vất vả, cực khổ, những gia đình của cậu vẫn luôn ngập tràn hạnh phúc. Nhưng niềm hạnh phúc ấy cũngkhông kéo dài lâu được. Một ngày nọ, khi Tanjiro trở về, cậu phát hiện gia đình mình đã bị sát hại dã man, và chỉ có một người duy nhất sống sót, đó là em gái Nezuko của cậu. Nhưng bi kịch thay, Nezuko đã trở thành con quỷ đáng sợ. Tuy nhiên, cô vẫn còn giữ một chút nhân tính. Đó là thời điểm bắt đầu cuộc chiến đơn độc của Tanjiro, tiêu diệt quỷ và tìm cách biến em gái mình trở lại làm người.', '', 'kimetsu-no-yaiba', 'Vào thời xa xưa, có một truyền thuyết về những con quỷ ăn thịt người luôn lãng vãng trong cánh rừng sâu. Vì điều này, người dân trong làng không bao giờ đi ra ngoài vào trời tối. Truyền thuyến cũng kể...', 'kimetsu-no-yaiba', '', '', '', '', ''),
(76, 1, 'Kimetsu no Yaiba: Yuukaku-hen', '<p>M&ugrave;a thứ 2 của anime Kimetsu No Yaiba xoay quanh arc khu phố đ&egrave;n đỏ đội của Tanjiro c&ugrave;ng với &acirc;m trụ chiến đấu với 2 anh em thượng lục quỷ</p>', 'Mùa thứ 2 của anime Kimetsu No Yaiba xoay quanh arc khu phố đèn đỏ đội của Tanjiro cùng với âm trụ chiến đấu với 2 anh em thượng lục quỷ', '', 'kimetsu-no-yaiba-yuukaku-hen', 'Mùa thứ 2 của anime Kimetsu No Yaiba xoay quanh arc khu phố đèn đỏ đội của Tanjiro cùng với âm trụ chiến đấu với 2 anh em thượng lục quỷ', 'kimetsu-no-yaiba-yuukaku-hen', '', '', '', '', ''),
(77, 1, 'Kimetsu no Yaiba: Katanakaji no Sato-hen (Ss3)', '<p>M&ugrave;a thứ 3 của anime Kimetsu no Yaiba Arc L&agrave;ng thợ r&egrave;n.</p>\r\n<p>Sau khi lấy lại &yacute; thức, nơi Tanjiro hướng tới tiếp theo l&agrave; \"l&agrave;ng của thợ r&egrave;n kiếm\". Tại đ&acirc;y, cậu t&aacute;i ngộ H&agrave; Trụ Tokito Muichiro v&agrave; Luyến Trụ Kanroji Mitsuri, l&agrave; những kiếm sĩ mạnh nhất của Đội diệt quỷ. H&igrave;nh b&oacute;ng của quỷ cũng đang ẩn nấp ngay trong ng&ocirc;i l&agrave;ng n&agrave;y.</p>', 'Mùa thứ 3 của anime Kimetsu no Yaiba Arc Làng thợ rèn.\r\nSau khi lấy lại ý thức, nơi Tanjiro hướng tới tiếp theo là \"làng của thợ rèn kiếm\". Tại đây, cậu tái ngộ Hà Trụ Tokito Muichiro và Luyến Trụ Kanroji Mitsuri, là những kiếm sĩ mạnh nhất của Đội diệt quỷ. Hình bóng của quỷ cũng đang ẩn nấp ngay trong ngôi làng này.', '', 'kimetsu-no-yaiba-katanakaji-no-sato-hen-ss3', 'Mùa thứ 3 của anime Kimetsu no Yaiba Arc Làng thợ rèn.\r\nSau khi lấy lại ý thức, nơi Tanjiro hướng tới tiếp theo là \"làng của thợ rèn kiếm\". Tại đây, cậu tái ngộ Hà Trụ Tokito Muichiro và Luyến Trụ Kan...', 'kimetsu-no-yaiba-katanakaji-no-sato-hen-ss3', '', '', '', '', '');
